import "./mine.css";
function mine(){
    return(
    <div className="mine-bg">
        <div id="self-info">
            <div id="avatar"></div>
            <div id="self-intro"></div>
            <div id="more-info"></div>
        </div>
    </div>)
}
export default mine;
